import React from "react";

const navbar = () => {
    return (
        <div className="navbar">
            <a href="/Discos">Nuestros Discos</a>
            <a href="/Letras">Letras</a>
            <a href="/Nosotros">Nosotros</a>
            <a href="/Contactanos">Contactanos</a>
        </div>

    )

}
export default navbar;
